1.1 Contratação de empresa especializada  em serviços de engenharia para a eleboração dos projetos de engenharia para as obras de contenções no Morro do Mocotó. 

Escopo dos serviços:
a) Levantamentos topográficos;
b) Sondagens geológicas;
c) Dimensionamento e Projeto Estrutural das contenções;
d) Memorial Descritivo com levantamento dos materiais.
